create table unlike
(
  addedAt   datetime     not null,
  id        int auto_increment
    primary key,
  addedById varchar(255) null,
  trackId   int          null,
  constraint FK_b27a5a25a166665a0d3a848c00e
    foreign key (addedById) references user (id),
  constraint FK_b372c48733e1ddfe17df97919a5
    foreign key (trackId) references queued_track (id)
);

